import Header from './Header';
import styled from 'styled-components';

const PageLayout = styled.div`
    margin: 0;
    padding: 0;
    background: #f2f2f2;
    font-family: 'Roboto Condensed', sans-serif;
    width: 640px;
`;

const Layout = props => (
    <PageLayout>
        <Header />
        {props.children}
    </PageLayout>
);

export default Layout;
